import logo from "./logo.svg";
import "./App.css";
import Map from "./Comp/Map";
import OverlayChat from "./Comp/OverlayChat";
import "flowbite";
import { useState } from "react";

import SpeechRecognition, {
  useSpeechRecognition,
} from "react-speech-recognition";

function App() {
  const [open, setOpen] = useState(true);

  return (
    <div className="App">
      <Map></Map>

      <OverlayChat open={open} setOpen={setOpen}></OverlayChat>
      <button
        className="absolute inset-x-0 shadow-xl  md:w-52 mx-auto border-2 border-red-600 -mt-80 z-10 inline-flex items-center justify-center rounded-none border h-10 w-10 transition duration-100 ease-in-out bg-white text-gray-900 font-semibold hover:bg-gray-300 focus:outline-none"
        onClick={() => {
          setOpen(true);
        }}
      >
        Send message
      </button>
    </div>
  );
}

export default App;
